description:
LEX.UZ – O‘zbekiston Respublikasi Qonunchilik maʼlumotlari milliy bazasi orqali normativ-huquqiy hujjatlarni oson hamda qulay shaklda izlash va ular bilan tanishish imkonini beradi.

Mazkur mobil ilovaning qulay xususiyatlari:
– universal hamda kengaytirilgan qidiruv;
– tanlangan hujjatlarni shaxsiy kabinetda ko‘rsatish;
– so‘nggi qabul qilingan qonunchilik hujjatlari bilan tanishish;
– hujjat bilan tanishish uchun maxsus qo‘shimcha sozlanmalar;
– hujjatlarni qulay formatlarda yuklab olish.
